const fetchData = (city) => {
  fetch(
    `https://api.openweathermap.org/data/2.5/forecast?q=${city}&units=metric&APPID=a2b4e52032d2ff195e2ec1133387d853`
  )
    .then((res) => res.json())
    .then((res) => {
      console.log(res);
      return res;
    })
    .catch((error) => console.log(error));
};

export default fetchData;
